uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel1; // METAL TEXTURE(Slot 1)

// User Parameter
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_twist;
uniform float u_thickness;
uniform float u_glow_intensity;
uniform float u_wave_height;
uniform float u_wave_freq;
uniform float u_blob_size;
uniform float u_reflectivity;
uniform float u_arm_count; // Added to control the number of strands

out vec4 fragColor;

// --- Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// --- Blob Deformation Logic ---
float getBlobDeform(vec3 p) {
    float t = iTime * u_speed;
    float wave = sin(p.x * u_wave_freq + t) * cos(p.y * u_wave_freq * 0.8 + t * 0.5);
    wave += 0.5 * sin(p.z * u_wave_freq * 1.5 - t * 1.2);
    wave *= u_wave_height;
    return wave;
}

// Distance Function
float map(vec3 p) {
    float t = iTime * u_speed * 0.5;

    // The Reflective Floor (Flat plane)
    float floorDist = p.y + 1.0; 

    // Large Blob Body
    vec3 blobP = p - vec3(0.0, u_blob_size * 0.5, 0.0);
    float waveHeight = getBlobDeform(blobP);
    float blob = length(blobP) - u_blob_size + waveHeight;

    // Twisted Strands inside/around the blob
    float strands = 1e10;
    // Increased iteration count to handle up to the requested 20 arms
    for(float i = 0.0; i < 20.0; i += 1.0) {
        if (i >= u_arm_count) break; // Dynamically stop based on uniform

        float offset = i * (6.2831 / u_arm_count); // Distribute arms evenly in a circle
        vec3 q = blobP;
        q.xz *= rot(p.y * u_twist + t + offset);
        q.xy *= rot(t * 0.2 + i * 0.5); // Add individual variation to arms

        // Ribbon thickness logic
        float ribbon = length(q.xz - vec2(u_blob_size * 0.5, 0.0)) - u_thickness * (0.8 + 0.4 * sin(p.y * 2.0 + t + i));
        strands = smin(strands, ribbon, 0.8);
    }

    float blobWithStrands = smin(blob, strands, 0.5);

    // Combine floor and blob
    return min(floorDist, blobWithStrands);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float globalTime = iTime * u_speed;

    // --- Camera ---
    vec3 ro = vec3(sin(iTime*0.2)*u_camera_dist, u_camera_dist*0.6, cos(iTime*0.2)*u_camera_dist);
    vec3 ta = vec3(0.0, 1.0, 0.0);

    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0, 1, 0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + u_fov * cw);

    // --- Raymarching ---
    float t = 0.0;
    float d = 0.0;
    float glow = 0.0;

    for(int i = 0; i < 100; i++) { 
        vec3 p = ro + rd * t;
        d = map(p);
        // Only glow if near the blob (y > -0.9)
        if(p.y > -0.9) glow += 0.012 / (0.1 + d * d);
        if(d < 0.001 || t > 50.0) break;
        t += d; 
    }

    vec3 col = vec3(0.02, 0.03, 0.06); // Background color

    // --- Shading ---
    if(t < 50.0) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        bool isFloor = p.y < -0.95;

        if (isFloor) {
            vec3 floorTex = texture(iChannel1, p.xz * 0.1).rgb;
            col = vec3(0.05, 0.06, 0.1) * (0.5 + 0.5 * floorTex);

            vec3 roRef = p + n * 0.01;
            vec3 rdRef = reflect(rd, n);
            float tRef = 0.0;
            float dRef = 0.0;
            for(int j = 0; j < 40; j++) {
                dRef = map(roRef + rdRef * tRef);
                if(dRef < 0.01 || tRef > 20.0) break;
                tRef += dRef;
            }
            if(tRef < 20.0) {
                vec3 pRef = roRef + rdRef * tRef;
                vec3 iceColorRef = 0.6 + 0.4 * cos(vec3(0.0, 0.4, 0.8) + pRef.x * 0.2);
                col += iceColorRef * u_reflectivity * exp(-tRef * 0.2);
            }
        } else {
            vec3 iceColor = 0.6 + 0.4 * cos(vec3(0.0, 0.4, 0.8) + p.x * 0.2 + p.y * 0.5);
            vec3 mechTex = texture(iChannel1, p.xz * 0.3 + p.y * 0.2).rgb;
            if(length(mechTex) < 0.05) mechTex = vec3(0.8);

            vec3 interior = mechTex * iceColor * 0.8;
            vec3 lp = vec3(5.0, 10.0, 5.0);
            vec3 ld = normalize(lp - p);
            float diff = max(dot(n, ld), 0.0);
            float fres = pow(1.0 + dot(rd, n), 3.0);
            float spec = pow(max(dot(ref, ld), 0.0), 64.0); 

            col = interior * diff;
            col += vec3(0.6, 0.9, 1.0) * fres * 1.5; 
            col += vec3(1.0) * spec; 
        }
    }

    vec3 glowCol = 0.5 + 0.5 * cos(vec3(0.0, 0.3, 0.6) + globalTime * 0.3);
    col += glow * glowCol * u_glow_intensity;

    col = mix(col, vec3(0.02, 0.04, 0.08), smoothstep(15.0, 50.0, t));
    col = smoothstep(-0.05, 1.1, col);
    col = pow(col, vec3(0.9)); 

    fragColor = vec4(col, 1.0);
}
